import React from "react";
import "./App.css";

type Title = {
  title: String;
};

function App({ title }: Title): JSX.Element {
  return (
    <>
      <div className="App">
        <h1 className="title">Workshop-{title} </h1>
      </div>
    </>
  );
}

export default App;
